        <div className="dropdown">
          <button className="dropbtn">Cities</button>
          <div className="dropdown-content">
            <a href="#">Mumbai</a>
            <a href="#">Delhi</a>
            <a href="#">Ahemdabad</a>
            <a href="#">Bangalore</a> 
